import React from 'react';
import './App.css';
import ProductsList from './components/ProductsList';
import StoreContextProvider from './contexts/StoreContext';
import Checkout from './components/Checkout';

function App() {
  return (
    <div className="App">
    <StoreContextProvider>
      <ProductsList />
      <Checkout />
    </StoreContextProvider>
    </div>
  );
}

export default App;
